window.bookSummaryJSON = "<p><i>USA Today </i>best-selling author Taylor Aston White brings you this complete dark urban fantasy series.</p> <p>An amateur witch. A dark past. A fierce deceit.</p> <p>Paladin Agent Alice Skye didn’t think much of the contract forced upon her by Rexley Wild, Alpha of one of the largest packs in Europe.</p> <p>He hired her for one job.</p> <p>Find the missing wolf.</p> <p>Unfortunately for Alice, she might already be too late.</p> <p>She's in way over her head, an inexperienced witch who has to use all her instincts to help the secretive and detached Alpha find his missing pack mate. But it isn’t long before she realizes something’s not quite right. It wasn't a missing person–it was something a lot closer to home. Something that reignites nightmares that make her question her own horrific past.</p> <p>Alice is in a race against time that forces her to face against vampires, daemons, and anything that gets in the way, for she only has one thing to do–find the wolf before he turns up like the others.</p> <p>Dead.</p> <p>Unexpected twists, dark secrets and nail-biting action that will keep you on the edge of your seat.</p> <p>Alice Skye is the exciting new urban fantasy series by Taylor Aston White. Follow Alice as she battles her nightmares in the modern world of magic.</p> <p>Disclaimer: This novel is written in British English, including spelling and grammar.</p>"; 
